import React, { Component } from "react";
import { Icon, Collapse, Timeline } from "antd";
const { Panel } = Collapse;
// import { SmileOutlined } from '@ant-design/icons';

class DeathSideDisplay extends Component {
  constructor(props) {
    super(props);

    this.state = {
      list1: [
        { PersonalInstructions: "here", UploadFileHere: "abc.jpeg" },
        { PersonalInstructions: "ali", UploadFileHere: "abc.jpeg" },
        { PersonalInstructions: "asghar", UploadFileHere: "abc.jpeg" },
      ],
    };
  }

  getContactListRows = (item) => {
    return (
      <Timeline>
        <Timeline.Item color="#00CCFF" style={{ fontSize: "16px" }}>
          <p>Contact List</p>
        </Timeline.Item>

        <Timeline.Item>
          {"Name"} : {item.Name}
        </Timeline.Item>
        <Timeline.Item>
          {"Last Name"} : {item.LastName}
        </Timeline.Item>
        <Timeline.Item>
          {"Address"} : {item.Address}
        </Timeline.Item>
        <Timeline.Item>
          {"City"} : {item.City}
        </Timeline.Item>
        <Timeline.Item>
          {"State"} : {item.State}
        </Timeline.Item>
        <Timeline.Item>
          {"Country"} : {item.Country}
        </Timeline.Item>
        <Timeline.Item>
          {"Zip Code"} : {item.ZipCode}
        </Timeline.Item>
        <Timeline.Item>
          {"Phone"} : {item.Phone}
        </Timeline.Item>
        <Timeline.Item>
          {"Alternate Phone"} : {item.AlternatePhone}
        </Timeline.Item>
        <Timeline.Item>
          {"Part Of My Professional Team"} : {item.PartOfMyProfessionalTeam}
        </Timeline.Item>
        <Timeline.Item>
          {"Company"} : {item.Company}
        </Timeline.Item>
        <Timeline.Item>
          {"Type Of Relation"} : {item.TypeOfRelation}
        </Timeline.Item>
        <Timeline.Item>
          {"Notes"} : {item.Notes}
        </Timeline.Item>

        <Timeline.Item color="#00CCFF" style={{ fontSize: "16px" }}>
          <p>Professional Team</p>
        </Timeline.Item>

        <Timeline.Item>
          {"Name"} : {item.tName}
        </Timeline.Item>
        <Timeline.Item>
          {"Last Name"} : {item.tLastName}
        </Timeline.Item>
        <Timeline.Item>
          {"Address"} : {item.tAddress}
        </Timeline.Item>
        <Timeline.Item>
          {"City"} : {item.tCity}
        </Timeline.Item>
        <Timeline.Item>
          {"State"} : {item.tState}
        </Timeline.Item>
        <Timeline.Item>
          {"Country"} : {item.tCountry}
        </Timeline.Item>
        <Timeline.Item>
          {"Zip Code"} : {item.tZipCode}
        </Timeline.Item>
        <Timeline.Item>
          {"Phone"} : {item.tPhone}
        </Timeline.Item>
        <Timeline.Item>
          {"Alternate Phone"} : {item.tAlternatePhone}
        </Timeline.Item>
        <Timeline.Item>
          {"Part Of My Professional Team"} : {item.tPartOfMyProfessionalTeam}
        </Timeline.Item>
        <Timeline.Item>
          {"Company"} : {item.tCompany}
        </Timeline.Item>
        <Timeline.Item>
          {"Type Of Relation"} : {item.tTypeOfRelation}
        </Timeline.Item>
        <Timeline.Item>
          {"Notes"} : {item.tNotes}
        </Timeline.Item>
      </Timeline>
    );
  };

  getImportantDocumentsRows = (item) => {
    return (
      <Timeline>
        <Timeline.Item color="#00CCFF" style={{ fontSize: "16px" }}>
          <p>Important Documents</p>
        </Timeline.Item>

        <Timeline.Item>
          {"Document Name"} : {item.DocumentName}
        </Timeline.Item>
        <Timeline.Item>
          {"Document Type"} : {item.DocumentType}
        </Timeline.Item>
        <Timeline.Item>
          {"Storage Location Of Document"} : {item.StorageLocationOfDocument}
        </Timeline.Item>
        <Timeline.Item>
          {"Reciept"} : {item.File}
        </Timeline.Item>
        <Timeline.Item>
          {"Notes"} : {item.Notes}
        </Timeline.Item>

        <Timeline.Item color="#00CCFF" style={{ fontSize: "16px" }}>
          <p>Insurance Poilicies</p>
        </Timeline.Item>

        <Timeline.Item>
          {"Policy's Nickname"} : {item.PolicysNickname}
        </Timeline.Item>
        <Timeline.Item>
          {"Policy Number"} : {item.PolicyNumber}
        </Timeline.Item>
        <Timeline.Item>
          {"Carrier"} : {item.Carrier}
        </Timeline.Item>
        <Timeline.Item>
          {"Contact Name"} : {item.ContactName}
        </Timeline.Item>
        <Timeline.Item>
          {"Insurance Type"} : {item.InsuranceType}
        </Timeline.Item>
        <Timeline.Item>
          {"Contact Phone"} : {item.ContactPhone}
        </Timeline.Item>
      </Timeline>
    );
  };

  getEmailsTextsRows = (item) => {
    return (
      <Timeline>
        <Timeline.Item color="#00CCFF" style={{ fontSize: "16px" }}>
          <p>Emails</p>
        </Timeline.Item>

        <Timeline.Item>
          {"To"} : {item.To}
        </Timeline.Item>
        <Timeline.Item>
          {"CC"} : {item.CC}
        </Timeline.Item>
        <Timeline.Item>
          {"Subject"} : {item.Subject}
        </Timeline.Item>
        <Timeline.Item>
          {"Relationship"} : {item.Relationship}
        </Timeline.Item>
        <Timeline.Item>
          {"Template Nickname"} : {item.TemplateNickname}
        </Timeline.Item>
        <Timeline.Item>
          {"Template"} : {item.Template}
        </Timeline.Item>

        <Timeline.Item color="#00CCFF" style={{ fontSize: "16px" }}>
          <p>Texts</p>
        </Timeline.Item>

        <Timeline.Item>
          {"To"} : {item.TextTo}
        </Timeline.Item>
        <Timeline.Item>
          {"Phone"} : {item.Phone}
        </Timeline.Item>
        <Timeline.Item>
          {"Relationship"} : {item.TextRelationship}
        </Timeline.Item>
        <Timeline.Item>
          {"Template Nickname"} : {item.TextTemplateNickname}
        </Timeline.Item>
        <Timeline.Item>
          {"Text Message"} : {item.TextMessage}
        </Timeline.Item>
      </Timeline>
    );
  };

  getPrepaidBurialExpensesRows = (item) => {
    return (
      <Timeline>
        <Timeline.Item>
          {"Name Of Place"} : {item.NameOfPlace}
        </Timeline.Item>
        <Timeline.Item>
          {"Location / Plot"} : {item.Location}
        </Timeline.Item>
        <Timeline.Item>
          {"Address"} : {item.Address}
        </Timeline.Item>
        <Timeline.Item>
          {"Items Paid For"} : {item.ItemsPaidFor}
        </Timeline.Item>
        <Timeline.Item>
          {"Director"} : {item.Director}
        </Timeline.Item>
        <Timeline.Item>
          {"Phone Number"} : {item.PhoneNumber}
        </Timeline.Item>
        <Timeline.Item>
          {"Amount Paid"} : {item.AmountPaid}
        </Timeline.Item>
        <Timeline.Item>
          {"Date Paid"} : {item.DatePaid}
        </Timeline.Item>
        <Timeline.Item>
          {"Notes"} : {item.Notes}
        </Timeline.Item>
      </Timeline>
    );
  };

  getPersonalItemsRows = (item) => {
    return (
      <Timeline>
        <Timeline.Item>
          {"Personal Item"} : {item.PersonalItem}
        </Timeline.Item>
        <Timeline.Item>
          {"Location"} : {item.Location}
        </Timeline.Item>
        <Timeline.Item>
          {"Personal Wishes"} : {item.PersonalWishes}
        </Timeline.Item>
        <Timeline.Item>
          {"Notes"} : {item.Notes}
        </Timeline.Item>
      </Timeline>
    );
  };

  getLitigationRows = (item) => {
    return (
      <Timeline>
        <Timeline.Item>
          {"Litigation Nickname"} : {item.LitigationNickname}
        </Timeline.Item>
        <Timeline.Item>
          {"Potential Liability"} : {item.PotentialLiability}
        </Timeline.Item>
        <Timeline.Item>
          {"Potential Win/Loss"} : {item.PotentialWinLoss}
        </Timeline.Item>
        <Timeline.Item>
          {"Notes"} : {item.Notes}
        </Timeline.Item>
        <Timeline.Item>
          {"File"} : {item.Upload}
        </Timeline.Item>
      </Timeline>
    );
  };

  getBillsRows = (item) => {
    return (
      <Timeline>
        <Timeline.Item>
          {"Amount"} : {item.Amount}
        </Timeline.Item>
        <Timeline.Item>
          {"Payee Name"} : {item.PayeeName}
        </Timeline.Item>
        <Timeline.Item>
          {"Category"} : {item.Category}
        </Timeline.Item>
        <Timeline.Item>
          {"Frequency"} : {item.Frequency}
        </Timeline.Item>
        <Timeline.Item>
          {"Source"} : {item.Source}
        </Timeline.Item>
        <Timeline.Item>
          {"Whose Bill"} : {item.WhoseBill}
        </Timeline.Item>
        <Timeline.Item>
          {"Due Date"} : {item.DueDate}
        </Timeline.Item>

        <Timeline.Item>
          {"Reciept"} : {item.Receipt}
        </Timeline.Item>
        <Timeline.Item>
          {"Notes "} : {item.Notes}
        </Timeline.Item>
      </Timeline>
    );
  };

  getPersonalInstructionsRows = (item) => {
    return (
      <Timeline>
        <Timeline.Item>
          {"Personal Instructions"} : {item.PersonalInstructions}
        </Timeline.Item>
        <Timeline.Item>
          {"File"} : {item.UploadFileHere}
        </Timeline.Item>
      </Timeline>
    );
  };


  getAccountsAssetsRows = (item) => {
    return (
      <Timeline>
        <Timeline.Item>
          {"Asset Name"} : {item.AssetName}
        </Timeline.Item>
        <Timeline.Item>
          {"Held Where"} : {item.AccountType}
        </Timeline.Item>
        <Timeline.Item>
          {"Account Type"} : {item.HeldWhere}
